public Object getValue(){

var start = 0;
var length = 10;

Object m = dataRow.get("OGV_ADDRESS");

if( m == null ) return (String) "";

String ms = (m instanceof String)?((String)m):m.toString();

if (ms.length()<start) return (String)"";

if( start != 0 ){
	while(true){
		if( start == 0 )break;
		if( ms.charAt(start) == ' ' ){   
			start++;         
			break;
		}
		start--;
	}
}

if( (start + length) >= ms.length() ){
	length = ms.length() - start;
	return (String)ms.substring(start,start + length);
}else{
	while(true){
		if( ms.charAt(start + length) == ' ' )return (String)ms.substring(start,start + length);
		length--;
		if(length == 0)break;
	}
}

return (String) ".";
}

